package ch04;

public class NestedForExam {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i,j;
		
		for(i=0; i < 5 ; i ++) {
			System.out.printf("\n");
				for(j=0; j < 10 ; j ++) {
					System.out.printf("*");
				}
				System.out.printf("\n");
			}
	}

}
